import React, {Component} from 'react';
import '../css/navTab.css';

class NavTabDetail extends Component {
    render() {
        return (
                <div className="navItems">
            <button>

                    {this.props.nav.title}
            </button>

                </div>
        )
            }
}
export default NavTabDetail;
